import React, { Component } from 'react';
import Axios from 'axios';


export default class GetList2 extends Component {
    constructor() {
        super();
        this.state = {
            customers: [],
        };
    }


    componentWillMount() {
        var config = {
           
            headers: {
                'Content-Type': 'application/json',
                'Accept': 'application/json',
                'Access-Control-Allow-Origin': '*'
            },
        };

        debugger;
        //fetch('https://jsonplaceholder.typicode.com/todos/1')
        Axios('http://localhost:59982/api/Customer/GetList', config)
            .then((results) => results.json())
            .then((data) => {
                const array = [];
                array.push(data);
                this.setState({ customers: array })

            })
    }




    render() {
        debugger;
        if (this.state.customers.length === 0) {
            return (

                <div>
                    Loading....
                </div>
            )
        }

        const renderCustomer = this.state.customers.map((item) => {
            return (
                <div>
                    <p>{item.userId}</p>
                    <p>{item.id}</p>
                    <p>{item.title}</p>
                    <p>{item.completed}</p>
                </div>
            )
        })

        return (

            <div>
                {renderCustomer}
            </div>
        )
    }
};
